import React, { Component } from 'react';
import { ParallaxProivider, ParallaxBanner } from 'react-scroll-parallax';


class HomePage extends Component {
    render() {
        return(
            <ParallaxProivider>
                <h1>Hello</h1>
                <ParallaxBanner
                    className="your-class"
                    layers={[
                        {
                            image: './imgs/logo.png',
                            amount: 0.1,
                        },
                        {
                            image: './imgs/logo.png',
                            amount: 0.2,
                        },
                    ]}
                    style={{
                        height: '500px',
                    }}
                >
                    <h1>Banner Childredn</h1>
                </ParallaxBanner>
            </ParallaxProivider>
        )
    }   
}


export default HomePage;
